import React from 'react';
import s from './NavBar.module.css'
import { NavLink } from 'react-router-dom';

const NavBar = (props) => {
    return (
        <div className={s.header}>
            <NavLink to={'/'} activeClassName={s.active}>Главная</NavLink>
            <NavLink to={'/cost'} activeClassName={s.active}> Рассчитать стоимость</NavLink>
            <NavLink to={'/'} activeClassName={s.active}>Оставить заявку</NavLink>
            <NavLink to={'/'} activeClassName={s.active}>Акции</NavLink>
        </div>
    )
}
export default NavBar;
